import React, { useState } from 'react';
import axios from 'axios';
import {
  Box,
  Heading,
  FormControl,
  FormLabel,
  Input,
  Button,
  Center,
  Image,
  Select,
  HStack,
  ChakraProvider,
  Slider,
  SliderTrack,
  SliderFilledTrack,
  SliderThumb
} from '@chakra-ui/react';

function ImageUploader() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [responseImage, setResponseImage] = useState(null);
  const [selectedOption, setSelectedOption] = useState("None");

  const handleFileInput = (event) => {
    setSelectedFile(event.target.files[0]);
    setPreviewUrl(URL.createObjectURL(event.target.files[0]));
  };

  const handleOptionChange = (event) => {
    setSelectedOption(event.target.value);
  }

  const handleSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append('file', selectedFile);
    formData.append('option', selectedOption);

    try {
      const response = await axios.post('http://127.0.0.1:8000/upload-image/', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      console.log(response.data);
      setResponseImage(response.data)
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <ChakraProvider>
      <Box color="black" textAlign="center" py={3}>
        <Heading as="h1" size="xl" mb={4}>
          Draw My Face
        </Heading>
      </Box>
      <Box  bg="orange" color="black" textAlign="center" py={10}>
        <HStack marginLeft={40} spacing={500}>
          <form onSubmit={handleSubmit}>
            <FormControl>
              <FormLabel>Choose a file</FormLabel>
              <Input type="file" onChange={handleFileInput} bg="white"/>
            </FormControl>
            <FormControl mt={4}>
              <FormLabel>Select an option</FormLabel>
              <Select value={selectedOption} onChange={handleOptionChange} bg="white">
                <option value="None">None</option>
                <option value="Cartoon">Cartoon</option>
              </Select>
            </FormControl>
            <Slider defaultValue={2} min={0} max={4} step={1}>
              <SliderTrack bg='red.100'>
                <Box position='relative' right={10} />
                <SliderFilledTrack bg='tomato' />
              </SliderTrack>
              <SliderThumb boxSize={6} />
            </Slider>
            {previewUrl ? (
                <Center mt={4}>
                  <Box w={512} h={512} borderWidth="1px" borderColor="gray.200">
                    <Image src={previewUrl} w="100%" h="100%" objectFit="cover" />
                  </Box>
                </Center>
              ) : (
                <Center mt={4}>
                  <Box w={512} h={512} borderWidth="1px" borderColor="gray.200">
                    <Image src="https://via.placeholder.com/512x512.png?text=Placeholder" w="100%" h="100%" objectFit="cover" />
                  </Box>
                </Center>
            )}
            <Button type="submit" mt={4}>
              Upload
            </Button>
          </form>
          <Box>
            {responseImage ? (
              <Center mt={4}>
                <Box w={512} h={512} borderWidth="1px" borderColor="gray.200">
                  <Image src={`data:image/png;base64,${responseImage}`} w="100%" h="100%" objectFit="cover" />
                </Box>
              </Center>
            ) : (
              <Center mt={4}>
                <Box w={512} h={512} borderWidth="1px" borderColor="gray.200">
                  <Image src="https://via.placeholder.com/512x512.png?text=Placeholder" w="100%" h="100%" objectFit="cover" />
                </Box>
              </Center>
          )}
          </Box>
        </HStack>
      </Box>
    </ChakraProvider>
  );
}

export default ImageUploader;
